const express = require('express');
const app = express();


app.listen(3000, () => {
   console.log('Servidor rodando na porta 3000....')
});

app.get('/', (req,res) => {
   res.sendFile(__dirname+'/App.js')
})
app.get('/cliente', (req,res) => {
   res.sendFile('/cliente.js')
})
